import React from 'react';

const MyReports = ({ appraisal }) => {
  return (
    <div className="p-4">
      <h2 className="text-2xl font-bold mb-2">My Reports</h2>
      <p>This is the my reports tab. Add generated or saved reports here.</p>
      {appraisal && (
        <div className="mt-4 p-4 bg-gray-50 rounded-lg">
          <h3 className="text-lg font-semibold mb-2">Reports for {appraisal.address}:</h3>
          <p className="text-sm text-gray-600">
            No reports generated yet. Reports will appear here once analysis is complete.
          </p>
        </div>
      )}
    </div>
  );
};

export default MyReports;
